e Versandtarife an, die auf der von Google Distance Matrix API berechneten Entfernung oder Gesamtreisezeit basieren, und überzahle für den Versand nicht mehr.','Flexible Shipping Locations'=>'Flexible Shipping Standorte','Calculate the shipping cost based on location. Define your own custom locations, use the WooCommerce defaults or the ones created by 3rd party plugins.'=>'Berechne die Versandkosten basierend auf dem Standort. Bestätige deine eigenen benutzerdefinierten Standorte, verwende die WooCommerce-Standardwerte oder die von Drittanbieter-Plugins erstellten Standorten.','Flexible Printing'=>'Flexibler Druck','Automate your shipping process. Print the shipping labels on thermal printers via PrintNode service. Let the labels be printed automatically the same time the order is placed.'=>'Automatisiere deinen Versandprozess. Drucke die Versandetiketten auf Thermodruckern über den PrintNode-Service. Lass die Versandetiketten automatisch drucken, wenn die Bestellung aufgegeben wird.','Flexible Shipping Import / Export'=>'Flexible Shipping Import / Export','Use the CSV files to import or export your shipping methods. Edit, update, move or backup the ready configurations and shipping scenarios.'=>'Verwende die CSV-Dateien, um deine Versandmethoden zu importieren oder zu exportieren. Bearbeite, aktualisiere, verschiebe oder sichere die fertigen Konfigurationen und Versandszenarien.','DHL Express Live Rates PRO'=>'DHL Express WooCommerce Live-Versandtarife PRO','WooCommerce DHL Express integration packed with many advanced features. Display the dynamically calculated live rates for DHL Express shipping methods and adjust them to your needs.'=>'WooCommerce DHL Express Integration verpackt mit vielen erweiterten Funktionen. Zeige die dynamisch berechneten Live-Tarife für DHL Express-Versandmethoden an und passe sie an deine Bedürfnisse an.','Multi Vendor Shipping'=>'Multi Vendor Versand','Define precisely the shipping cost calculation rules for each Vendor / Product Author in your marketplace or multivendor store.'=>'Definiere genau die Regeln zur Berechnung der Versandkosten für jeden Verkäufer / Produktautor auf deinem Marktplatz oder Multivendor-Shop.','Shipping Packages'=>'Versandpakete','Split the WooCommerce cart content into multiple packages based on various conditions like shipping class.'=>'Teile den Inhalt des WooCommerce-Warenkorbs in mehrere Pakete auf, die auf verschiedenen Bedingungen wie der Versandklasse basieren.','Conditional Shipping Methods'=>'Bedingte Versandmethoden','Conditionally display and hide the shipping methods in your WooCommerce store. Define the rules when the specific shipping methods, e.g., live rates should be available to pick and when not to.'=>'Bedinge das Ein-und-Ausblenden der Versandmethoden in deinem WooCommerce-Shop. Definiere die Regeln, wann die spezifischen Versandmethoden, z. B. Live-Tarife, zur Auswahl verfügbar sein sollen und wann nicht.','Delivery Date Picker'=>'Lieferterminwähler','Let your customers choose a convenient delivery date for the ordered products and make the shipping cost dependent on the date they choose.'=>'Lass deine Kunden ein günstiges Lieferdatum für die bestellten Produkte wählen und mache die Versandkosten von dem gewählten Datum abhängig.','USPS Live Rates PRO'=>'USPS WooCommerce Live-Versandtarife PRO','Serve your customers the automatically and real-time calculated USPS shipping rates. Add the handling fees, insurance and adjust them to your needs with just a few clicks.'=>'Biete deinen Kunden die automatisch und in Echtzeit berechneten USPS-Versandtarife an. Füge die Bearbeitungsgebühren und die Versicherung hinzu und passe sie mit nur wenigen Klicks an deine Bedürfnisse an.','Shipping Cost on Product Page PRO'=>'Rechner der Versandkosten auf der Produktseite PRO','Let your customers calculate and see the shipping cost on product pages based on the entered shipping destination and cart contents. Decide how and when exactly you want the shipping cost calculator to display.'=>'Lass deine Kunden die Versandkosten auf den Produktseiten berechnen und anzeigen, basierend auf dem eingegebenen Versandziel und dem Inhalt des Warenkorbs. Entscheide wie und wann genau du den Versandkostenrechner anzeigen lassen möchtest.','DPD UK & DPD Local'=>'DPD UK & DPD Local','Ship your DPD orders faster with advanced DPD UK & DPD Local WooCommerce integration. Gather shipping details, download printable shipping labels and track parcels - everything is automated.'=>'Versende deine DPD Bestellungen schneller mit der erweiterten DPD UK & DPD Local WooCommerce Integration. Sammele die Versanddetails, lade die druckbare Versandetiketten herunter und verfolge Pakete - alles ist automatisiert.','All'=>'Alle','Live Rates'=>'Live-Versandtarife','Customizable Rates'=>'Benutzerdefinierter Versandtarif','Shipping Labels'=>'Versandetiketten','Link on plugin list pageExtensions'=>'Erweiterungen','Shipping Extensions by'=>'Versanderweiterungen von','Dive into a system of Octolize ecommerce shipping plugins for WooCommerce. Don’t lose your customers, time and money. Let our plugins secure your sales!'=>'Tauche ein in ein System von Octolize E-Commerce Versand Plugins für WooCommerce. Verliere keine Kunden, Zeit und kein Geld. Lass unsere Plugins deinen Umsatz sichern!','Filter plugins:'=>'Filter Plugins nach:','Buy plugin →'=>'Plugin kaufen →','Blackout Lead Days'=>'Ausschluss von Durchführungstagen','Blackout Lead Days are used to define days of the week when shop is not processing orders.'=>'Diese Option wird verwendet, um Tage in der Woche zu definieren, an denen der Shop keine Bestellungen bearbeitet.','Monday'=>'Montag','Tuesday'=>'Dienstag','Wednesday'=>'Mittwoch','Thursday'=>'Donnerstag','Friday'=>'Freitag','Saturday'=>'Samstag','Sunday'=>'Sonntag','Can\'t convert weight to target unit.'=>'Das Gewicht kann nicht in die Zieleinheit umgerechnet werden.','DHL Express'=>'DHL Express','Credentials'=>'API Einstellungen','You need to provide DHL Express account credentials to get live rates. Learn %1$show to create a DHL Express account →%2$s'=>'Du musst die Zugangsdaten für dein DHL Express-Konto angeben, um Live-Tarife zu erhalten. Erfahre %1$swie man ein DHL Express Konto erstellt →%2$s','Site ID'=>'Site ID','Password'=>'Kennwort','In order to get the %1$sSite ID%2$s log in to your DHL Express account %3$shere%4$s and copy it from %1$sMy profile%2$s or %1$sXML Services Status%2$s tabs. If you haven\'t received an email containing the %1$sSite ID%2$s and %1$spassword%2$s, please contact the DHL Express support directly.'=>'Um die %1$sSite ID%2$s zu erhalten, logg dich in dein DHL Express Konto %3$shier%4$s ein und kopiere sie aus den Registerkarten %1$sMein Profil%2$s oder %1$sXML Services Status%2$s. Wenn du keine E-Mail mit der %1$sSite ID%2$s und dem %1$sPasswort%2$s erhalten hast, wende dich bitte direkt an den DHL Express Support.','Test Credentials'=>'Test-Anmeldeinformationen','Enable to use test credentials'=>'Aktiviere die Verwendung von Test-Anmeldeinformationen','Method Settings'=>'Einstellungen der Methode','Set how DHL Express services are displayed.'=>'Lege fest, wie die DHL Express Dienstleistungen angezeigt werden.','Enable/Disable'=>'Aktivieren/Deaktivieren','Enable DHL Express global shipping method'=>'Aktiviere die globale DHL Express Versandmethode','If you need to turn off DHL Express rates display in the shop, just uncheck this option.'=>'Lass diese Option deaktiviert werden, wenn du die DHL Express-Tarife in deinem Shop nicht anzeigen möchtest.','Gain even more flexibility and add the DHL Express Live Rates within specific shipping zones instead of using the Global shipping method. %1$sUpgrade your DHL Express WooCommerce Live Rates plugin to PRO now →%2$s'=>'Gewinne noch mehr Flexibilität und füge die DHL Express Live-Tarife innerhalb bestimmter Versandzonen hinzu, anstatt die globale Versandmethode zu verwenden. %1$sUpgrade dein DHL Express WooCommerce Live-Versandtarife Plugin jetzt auf PRO →%2$s','Method Title'=>'Name der Methode','This controls the title which the user sees during checkout when fallback is used.'=>'Definiere den DHL Express Versandmethodetitel, den der Benutzer an der Kasse sieht, wenn Fallback verwendet wird.','Custom Services'=>'DHL Express Dienstleistungen','Enable custom services'=>'Benutzerdefinierte Einstellungen für Dienste aktivieren','Enable if you want to select available services. By enabling a service, it does not guarantee that it will be offered, as the plugin will only offer the available rates based on the package weight, the origin and the destination.'=>'Entscheide welche Dienstleistungen angezeigt werden sollen, ändere ihre Namen und Reihenfolge. Aktiviere diese Option, wenn du die verfügbaren Dienste auswählen möchtest. Die Aktivierung einer Dienstleistung garantiert nicht, dass sie angeboten wird, weil das Plugin nur die verfügbaren Tarife auf der Grundlage des Paketgewichts, der Absenderadresse und des Ziels anbietet.','Services Table'=>'DHL Express Dienstleistungen-Tabelle','Rates Adjustments'=>'Tarifanpassungen','Adjust these settings to get more accurate rates.'=>'Passe diese Einstellungen an, um genauere Tarife zu erhalten.','Discounted Rates'=>'Ermäßigte Tarife','Enable if you want to use discounted rates'=>'Aktiviere diese Option, wenn du die ermäßigten Tarife nutzen möchtest','If you want to use the rates assigned to your account, use the ID assigned to the payer\'s account. Contact DHL Express for more information.'=>'Wenn du deinem Konto zugewiesenen Tarife verwenden möchtest, verwende die dem Konto des Auftraggebers zugewiesene ID. Wende dich für weitere Informationen an DHL Express.','Payment Account Number'=>'Zahlungskontonummer','Insurance'=>'Versicherung','Request insurance to be included in DHL Express rates'=>'Beantrage die Aufnahme der Versicherung in die DHL Express Tarife','Enable if you want to include insurance in DHL Express rates when it is available.'=>'Aktiviere diese Option, wenn du eine Versicherung in die DHL Express Tarife aufnehmen möchtest, sofern diese verfügbar ist.','Parcel Packing Method'=>'Verpackungsmethode','Pack into one box by weight'=>'Alle Produkte zusammen in einer Versandverpackung','Pack items separately'=>'Alle Produkte separat verpacken','This option allows you to achieve more accurate Shipping Rates.'=>'Mit dieser Option kannst du genauere Versandtarife erzielen.','Duties & Taxes'=>'Zölle und Steuern','Determine the circumstances when the duties and taxes should be applied for international shipping.'=>'Bestimme die Umstände, unter denen die Zölle und Steuern für den internationalen Versand erhoben werden sollten.','Dutiable shipment'=>'Zollpflichtige Sendungen','Never'=>'Niemals','Always (except domestic shipping)'=>'Immer (außer Inlandsversand)','Only for selected countries'=>'Nur für bestimmte Länder','Always, except selected countries and domestic shipping'=>'Immer, außer bestimmte Länder und Inlandsversand','Define when the shipment you send should be considered as dutiable.'=>'Entscheide, wann die von dir verschickte Sendung als zollpflichtig zu betrachten ist.','Selected countries'=>'Bestimmte Länder','Choose the countries which the option selected in the \'Dutiable shipment\' field will be applied to.'=>'Wähle die Länder aus, die die im Feld "Zollpflichtige Sendungen” ausgewählte Option betrifft.','Advanced Options'=>'Erweiterte Einstellungen','Debug Mode'=>'Debug-Modus','Enable debug mode'=>'Debug-Modus aktivieren','Enable debug mode to display messages in the cart/checkout. Only admins and shop managers will see all messages and data sent to DHL Express. The customer will only see messages from the DHL Express API.'=>'Aktiviere den Debug-Modus, um die technischen Nachrichten im Warenkorb/an der Kasse anzuzeigen. Administratoren und Shop-Manager sehen alle Nachrichten und Daten, die an DHL Express gesendet werden. Der Kunde sieht nur Nachrichten von der DHL Express API.','Measurement Units'=>'Maßeinheiten','