>'Aktiviere den kostenlosen Versand über den Betrag','Tick this checkbox to enter the order amount above which the shipping becomes free.'=>'Aktiviere dieses Kontrollkästchen, um den Bestellwert einzugeben, ab dem der Versand kostenlos wird.','Free Shipping Threshold'=>'Schwellenwert für kostenlosen Versand','Enter only a numeric value without the currency symbol.'=>'Gib nur einen numerischen Wert ohne das Währungssymbol ein.','Fallback reason'=>'Ursache des Fallbacks','Packages'=>'Pakete','Custom'=>'Benutzerdefiniert','No rates added from collection point rates!'=>'Keine Zuschläge von Sammelstellentarifen!','Collection point not found.'=>'Sammelstelle nicht gefunden.','There was no valid services available.'=>'Es waren keine gültigen Dienstleistungen verfügbar.','Fallback rate added with reason: %1$s'=>'Ursache für das Fallback: %1$s','No rates added from standard service rates!'=>'Keine Aufschläge auf die Standardtarife!','Fallback'=>'Fallback','Enable fallback'=>'Fallback einschalten','Enable to offer flat rate cost for shipping so that the user can still checkout, if API for some reason returns no matching rates.'=>'Aktiviere das Angebot von Pauschalpreisen für den Versand, damit der Benutzer immer noch zur Kasse gehen kann, wenn die API aus irgendeinem Grund keine passenden Preise liefert.','Fallback Cost'=>'Fallback-Kosten','We noticed that you are using the Germanized plugin along with %1$s. In order to display the accurate rates, please select the WooCommerce default option in the Germanized Taxes > Additional Costs > Tax calculation mode settings. %2$sNeed assistance? Get in touch →%3$s'=>'Wir haben festgestellt, dass du das Germanized Plugin zusammen mit %1$s verwendest. Um die korrekten Tarife anzuzeigen, wähle die WooCommerce Standard in den Germanized Einstellungen Steuern > Nebenkosten > Steuerberechnung. %2$sBrauchst du Hilfe? Nimm Kontakt auf →%3$s','Show %1$s'=>'Anzeigen %1$s','Hide %1$s'=>'Ausblenden %1$s','Copy %1$s to clipboard'=>'Kopieren %1$s in die Zwischenablage','(Delivery Days: 0 days)'=>'(Liefertage: 0 Tage)','(Delivery Days: %1$d day)'=>'(Liefertage: %1$d Tag)' . "\0" . '','(Delivery Date: %1$s)'=>'(Lieferdatum: %1$s)','Awesome, you\'ve been using %s for more than 2 weeks. Could you please do me a BIG favor and give it a 5-star rating on WordPress? ~ Peter'=>'Toll, du hast %s schon seit mehr als 2 Wochen benutzt. Könntest du mir bitte einen GROSSEN Gefallen tun und ihm eine 5-Sterne-Bewertung auf WordPress geben? ~ Peter','%1$sOk, you deserved it%2$s'=>'%1$s Ok, du hast es verdient %2$s','%1$sNope, maybe later%2$s'=>'%1$s Nein, vielleicht später%2$s','%1$sI already did%2$s'=>'%1$sSchon getan%2$s','Created with %1$s by %2$s - If you like %3$s you can %4$srate us %5$s in plugins repository &rarr;%6$s'=>'Erstellt mit %1$s von %2$s - Hat es dir %3$s gefallen, könntest du uns %4$s%5$s in plugins Repository bewerten &rarr;%6$s','The plugin suddenly stopped working'=>'Das PlugIn funktioniert plötzlich nicht mehr','The plugin broke my site'=>'Das Plugin hat meine Seite gestört','I have found a better plugin'=>'Ich habe ein besseres Plugin gefunden','What\'s the plugin\'s name?'=>'Wie heißt das PlugIn?','I only needed the plugin for a short period'=>'Ich brauchte das Plugin nur für einen kurzen Zeitraum','I no longer need the plugin'=>'Ich brauche das Plugin nicht mehr','It\'s a temporary deactivation. I\'m just debugging an issue.'=>'Es ist eine vorübergehende Deaktivierung. Ich debugge gerade ein Problem.','Other'=>'Andere','Please let us know how we can improve our plugin'=>'Bitte teile uns mit, wie wir unser Plugin verbessern können','Plugin deactivation'=>'Plugin-Deaktivierung','You are deactivating %s plugin.'=>'Das %s Plugin wird gerade deaktiviert.','Skip &amp; Deactivate'=>'Überspringen &amp; deaktivieren','Submit &amp; Deactivate'=>'Absenden &amp; Deaktivieren','Cancel'=>'Abbrechen','You successfully opted out of collecting usage data by %1$s. If you change your mind, you can always opt in later in the plugin\'s quick links.'=>'Du hast dich bis %1$s erfolgreich gegen die Erfassung von Nutzungsdaten entschieden. Wenn du deine Meinung änderst, kannst du dich später über die Quicklinks des Plugins wieder anmelden.','Opt-in'=>'Opt-in','Opt-out'=>'Opt-out','Hey %s,'=>'Hallo %s,','Please help us improve our plugins! If you opt-in, we will collect some non-sensitive data and usage information anonymously. If you skip this, that\'s okay! All plugins will work just fine.'=>'Bitte hilf uns, unsere Plugins zu verbessern! Wenn du zustimmst, sammele wir einige nicht-sensible Daten und Nutzungsinformationen. Wenn du stattdessen überspringst, es ist okay! Alle Plugins werden dennoch ganz normal funktionieren.','Allow & Continue &rarr;'=>'Zulassen & Weiter &rarr;','Skip'=>'Überspringen','What permissions are being granted?'=>'Welche Berechtigungen werden erteilt?','Your Site Overview'=>'Deine Website-Übersicht','WP version, PHP info'=>'WP Version, PHP Info','Plugin Usage'=>'Plugin Nutzung','Current settings and usage information of %1$s plugins'=>'Aktuelle Einstellungen und Nutzungsinformationen von %1$s Plugins','Your Store Overview'=>'Überblick über deinen Shop','Anonymized and non-sensitive store usage information'=>'Anonymisierte und nicht sensible Speichernutzungsinformationen','Find out more &raquo;'=>'Erfahre mehr &raquo;','Current settings and usage information of WP Desk plugins'=>'Aktuelle Einstellungen und Nutzungsinformationen von WP Desk Plugins',' If you have a moment, please let us know why you are deactivating plugin (anonymous feedback):'=>' Wenn du einen Moment Zeit hast, lass uns bitte wissen, warum du das Plugin deaktivierst (anonymes Feedback):','I found a better plugin'=>'Ich habe ein besseres Plugin gefunden','Kindly tell us the reason so we can improve'=>'Nenne bitte den Grund, sodass wir uns stetig verbessern können','We need your help to improve <strong>WP Desk plugins</strong>, so they are more useful for you and the rest of <strong>30,000+ users</strong>. By collecting data on how you use our plugins, you will help us a lot. We will not collect any sensitive data, so you can feel safe.'=>'Wir benötigen Ihre Hilfe, um die <strong>WP-Desk-Plugins</strong> zu verbessern, so dass sie noch nützlicher für dich und den Rest der <strong>30,000+ Benutzer</strong> sind. Indem wir Daten darüber sammeln, wie du unsere Plugins verwendest, hilfst du uns sehr. Wir sorgen dafür, dass keine sensible Daten gesammelt werden.','You successfully opted out of collecting usage data by WP Desk. If you change your mind, you can always opt in later in the plugin\'s quick links.'=>'Du hast erfolgreich angegeben, dass du keine Nutzungsdaten mit WP Desk teilen möchtest. Wenn du deine Meinung ändern solltest, könntest du jederzeit über die Quicklinks des Plugins zustimmen.','https://octol.io/dhlexpress-author'=>'https://octol.io/dhlexpress-author','DHL Express for WooCommerce'=>'DHL Express Live-Tarife','Upgrade'=>'Upgrade','The &#8220;%s&#8221; plugin cannot run on PHP versions older than %s. Please contact your host and ask them to upgrade.'=>'Das &#8220;%s&#8221; Plugin kann nicht mit PHP-Versionen älter als %s ausgeführt werden. Bitte kontaktiere deinen Hoster und bitte ihn darum, ein Upgrade durchzuführen.','The &#8220;%s&#8221; plugin cannot run on WordPress versions older than %s. Please update WordPress.'=>'Das &#8220;%s&#8221; Plugin kann nicht auf WordPress-Versionen ausgeführt werden, die älter als %s sind. Bitte aktualisiere WordPress.','The &#8220;%s&#8221; plugin cannot run on WooCommerce versions older than %s. Please update WooCommerce.'=>'Das &#8220;%s&#8221; Plugin kann nicht auf WooCommerce-Versionen ausgeführt werden, die älter als %s sind. Bitte aktualisiere WooCommerce.','The &#8220;%s&#8221; plugin cannot run without OpenSSL module version at least %s. Please update OpenSSL module.'=>'Das &#8220;%s&#8221; Plugin kann nicht ohne mindestens %s OpenSSL-Modulversion ausgeführt werden. Bitte aktualisiere das OpenSSL-Modul.','The &#8220;%1$s&#8221; plugin requires at least %2$s version of %3$s to work correctly. Please update it to its latest release.'=>'Das Plugin &#8220;%1$s&#8221; benötigt mindestens %2$s Version von %3$s, um korrekt zu funktionieren. Bitte aktualisiere es auf die neueste Version.','The &#8220;%s&#8221; plugin cannot run without %s active. Please install and activate %s plugin.'=>'Das &#8220;%s&#8221; Plugin kann nicht ohne aktives %s ausgeführt werden. Bitte installiere und aktiviere das %s Plugin.','The &#8220;%s&#8221; plugin requires free %s plugin. <a href="%s">Install %s</a>'=>'Das &#8220;%s&#8221; Plugin erfordert ein kostenloses %s Plugin. <a href="%s">Installiere %s</a>','The &#8220;%s&#8221; plugin requires activating %s plugin. <a href="%s">Activate %s</a>'=>'Das &#8220;%s&#8221; Plugin erfordert die Aktivierung des %s Plugins. <a href="%s">Aktiviere %s</a>','The &#8220;%s&#8221; plugin cannot run without %s PHP module installed. Please contact your host and ask them to install %s.'=>'Das &#8220;%s&#8221; Plugin kann nicht laufen, wenn kein %s PHP-Modul installiert ist. Bitte kontaktiere deinen Hoster und bitte ihn, %s zu installieren.','The &#8220;%s&#8221; plugin cannot run without %s PHP setting set to %s. Please contact your host and ask them to set %s.'=>'Das &#8220;%s&#8221; Plugin kann nicht laufen ohne die %s PHP-Einstellung auf %s zu setzen. Bitte kontaktiere deinen Hoster und bitte ihn, %s zu setzen.','The &#8220;%s&#8221; plugin is temporarily disabled since the required %s plugin is being upgraded.'=>'Das Plugin &#8220;%s&#8221; ist vorübergehend deaktiviert, da das erforderliche %s Plugin gerade aktualisiert wird.','Shipping service should implements CanTestSettings interface! Or overwrite this method'=>'Der Versanddienst sollte die CanTestSettings-Schnittstelle implementieren oder überschreiben Sie diese Methode','If you have a moment, please let us know why you are deactivating the plugin (anonymous feedback):'=>'Wenn du einen Moment Zeit hast, lass uns bitte wissen, warum du das Plugin deaktiviert hast (anonymes Feedback):']];